function Avatar() {
  return (
    <img
      className="avatar"
      src="https://i.imgur.com/1bX5QH6.jpg"
      alt="Lin Lanying"
      width={100}
      height={100}
    />
  );
}

function App() {
  return (
    <div className="App">
      <h1>Fala rapaziada</h1>
      <Avatar />
    </div>
  );
}

export default App;
